package com.operators;

public class ExampleForRelationalOperators {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 10, b = 20;
		char c = 'a';
		char t = 'd';
		System.out.println(a >= b);
		System.out.println(a == b);
		System.out.println(a != b);
		System.out.println(a < b);
		System.out.println(c > t);
	}
}